module.exports = "<ancb-page-header mytitle=\"Flyout Panel Example\"></ancb-page-header>\n\n<div class=\"row\">\n  <div class=\"col-xs-12\">\n    <h2>Introduction</h2>\n    <p>\n      The flyout panel component displays a panel on the bottom-right side of the browser window.  \n      Initially the panel is closed.  When the user clicks the panel tab, the panel animates open.  \n      When user clicks the panel tab again, the panel animates closed.    \n    </p>\n  </div>\n  <div class=\"col-xs-12\">\n    <h2>Technicals</h2>\n    <p>\n      Panel animation is done using css.  The open class animates the panel open in 1 second.  Similarly, \n      when the open class is removed, the default css animates the panel closed in 1 second.\n    </p>\n    <div>\n      <p>\n      The flyout component takes two inputs:\n      </p>\n      <ul>\n        <li>A tabText property binding set to the desired tab text.</li>\n        <li>An ng-content input which passes all html content placed between\n          the ancb-flyout-panel directive.  The content is then dropped into the panel\n          content section.\n        </li>\n      </ul>\n      <p>\n        The flyout component emits a panelOpenChange event when the panel tab is clicked.  The example hooks into,\n        this event using the OnChanges lifecycle hook and changes the optional reanimate bound boolean property.\n        Thus, when the panel is opened the meter is animated.  Note the meter does not animate on close.\n      </p>\n      <p>\n        In the live example, we drop the meter component into the content section of the flyout panel component.\n      </p>      \n    </div>\n  </div>  \n</div>\n\n<ancb-flyout-tab [tabText]=\"tabText\" (panelOpenChange)=\"test($event);\">\n  <ancb-meter [meter]=\"meter\" [reanimate]=\"reanimate\">           \n    <div><span [style.color]=\"'white'\">{{pointsCounter}}/{{meter.whole}}</span></div>\n  </ancb-meter>\n</ancb-flyout-tab>\n"

